// Navigation.js
import React from 'react';
import './Navigation.css'; // Import CSS file for styling

const Navigation = () => {
  const scrollToSection = (sectionId) => {
    const section = document.getElementById(sectionId);
    if (section) {
      section.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <nav className="navbar">
      <span className="navbar-title">SJSU Club Matching</span>
      <ul>
        <li><button onClick={() => scrollToSection('dashboard')}>Dashboard</button></li>
        <li><button onClick={() => scrollToSection('club-registration')}>Club Registration</button></li>
        <li><button onClick={() => scrollToSection('user-registration')}>User Registration</button></li>
        <li><button onClick={() => scrollToSection('club-matching-survey')}>Club Matching Survey</button></li>
      </ul>
    </nav>
  );
};

export default Navigation;
